        EnumC26804gjj enumC26804gjj79 = new EnumC26804gjj("STORY_ACTIVE_SNAPS", 78, "StoryViewActiveSnaps", "CREATE VIEW IF NOT EXISTS StoryViewActiveSnaps AS\nSELECT\n    Story._id,\n    Story.storyId,\n    Story.userName,\n    Story.displayName,\n    Story.kind,\n    Story.groupStoryType,\n    Story.rankingId,\n    StorySnaps.isViewed AS viewed,\n    StorySnaps.latestSnapTimestamp AS latestTimeStamp,\n    StorySnaps.latestSnapExpirationTimestamp AS latestExpirationTimestamp\nFROM Story\nLEFT OUTER JOIN (\n    SELECT\n        StorySnap.storyRowId,\n        MAX(Snap.timestamp) AS latestSnapTimestamp,\n        MAX(StorySnap.expirationTimestamp) AS latestSnapExpirationTimestamp,\n        MIN(StorySnap.viewed) = 1 AS isViewed\n    FROM StorySnap\n    JOIN Snap ON StorySnap.snapRowId = Snap._id\n    GROUP BY StorySnap.storyRowId\n) AS StorySnaps ON Story._id = StorySnaps.storyRowId\nWHERE Story._id IN (SELECT DISTINCT StorySnap.storyRowId FROM StorySnap);", 1);
