        EnumC26804gjj enumC26804gjj80 = new EnumC26804gjj("PLAYABLE_FRIEND_STORIES_MAPPING", 79, "StoryViewPlayableFriendStoriesMapping", "CREATE VIEW IF NOT EXISTS StoryViewPlayableFriendStoriesMapping AS\nSELECT\n    -- For Friend Stories, there is no linked MobStoryMetadata and Story.storyId \n    -- resolves to username and\n    -- For Private Stories, Story.storyId is mobStoryId so instead \n    -- MobStoryMetadata.creatorUsername resolves to username\n    COALESCE(MobStoryMetadata.creatorUsername, Story.storyId) AS username,\n    Story._id AS storyRowId\nFROM Story\nLEFT OUTER JOIN MobStoryMetadata ON Story._id = MobStoryMetadata.storyRowId\nWHERE (\n    -- Include Friend Stories\n    Story.kind = 0 OR\n    -- Include Private Stories\n    (Story.kind = 1 AND MobStoryMetadata.storyType = 1)\n)", 1);
